message:
"O processo de secularização surge não da perda da fé, mas da perda do interesse social no mundo da fé. Começa no momento em que os homens sentem que a religião é irrelevante para o modo de vida comum e que a sociedade como tal não tem nada a ver  com as verdades da fé."

 ~Christopher Dawson

